import React from 'react'
import {SidebarData} from './SidebarData'

function SideMenu() {
  return (
    <div className="Sidebar" style={{maxWidth:"400px"}}>
      <ul className="SidebarList">
        {SidebarData.map((val,key) => {
          return(
          <li key={key} className="d-flex justify-content-start justify-content-md-center" style={{fontWeight:'700'}} onClick={() => {window.location.pathname = val.link}}>
            {""}
            <div>{val.title}</div>
          </li>
        )})}
      </ul>
    </div>
  )
}

export default SideMenu
